import React, { useState } from 'react';

const LogSleep = () => {

    const [sleepText, setSleepText] = useState({
        duration: null,
        score: null,
        bedtime: null
    });

    const handleChanges = e => {
        setSleepText({
            ...sleepText,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = e => {
        e.preventDefault()
        return null
    }

    return (
        <main>
            <h2>
                Log sleep
            </h2>
            <form>

                <label>
                    Sleep duration
                    <input />
                </label>

                <label>
                    Sleep score
                    <input />
                </label>

                <label>
                    Bedtime
                    <input />
                </label>

                <button onSubmit={handleSubmit}>
                    Log sleep
                </button>
            </form>
        </main>

    )
}

export default LogSleep;
